import { Router, Routes, Route, BrowserRouter } from "react-router-dom";
import "./App.css";
import Home from "./page/home";

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Router>
          <Routes>
            <Route path="/" element={<Home />} />
          </Routes>
        </Router>
      </BrowserRouter>
    </div>
  );
}

export default App;
